%spark
val numberOfFactors = 1;
val numberOfPaths = 5000;
val seed = 31415;
val initialValue = 1.0;
val riskFreeRate = z.input("risk free rate", "0.05").toString.toDouble;
val volatility = z.input("volatility", "0.25").toString.toDouble;

var timeDiscretization = new net.finmath.time.TimeDiscretization(0.0, 20, 0.25);
var brownianMotion = new net.finmath.montecarlo.BrownianMotion(timeDiscretization, numberOfFactors, numberOfPaths, seed);
var model = new net.finmath.montecarlo.assetderivativevaluation.BlackScholesModel(initialValue, riskFreeRate, volatility);
var process = new net.finmath.montecarlo.process.ProcessEulerScheme(brownianMotion);
var simulation = new net.finmath.montecarlo.assetderivativevaluation.MonteCarloAssetModel(model, process);

var maturity1 = 4.0;
var maturity2 = 5.0
var strike = 1.05;
var timeToMaturity = maturity2-maturity1;

var blackScholes = new java.util.function.DoubleUnaryOperator() { def applyAsDouble(x : Double) =
    net.finmath.functions.AnalyticFormulas.blackScholesGeneralizedOptionValue(x * Math.exp(riskFreeRate * timeToMaturity), volatility, timeToMaturity, strike, Math.exp(-riskFreeRate * timeToMaturity));
}

var value1 = simulation.getAssetValue(maturity1, 0);
var value2 = simulation.getAssetValue(maturity2, 0);
var payoff = value2.sub(strike).floor(0);
var innervalue = value1.sub(strike).floor(0);
var analyticvalue = value1.apply(blackScholes);

import org.apache.spark.ml.regression.LinearRegression
import org.apache.spark.ml.feature.LabeledPoint

val data = (0 to numberOfPaths-1).map(i => (payoff.get(i), org.apache.spark.ml.linalg.Vectors.dense(1, value1.get(i), value1.get(i)*value1.get(i)), value1.get(i), innervalue.get(i), analyticvalue.get(i))).toDF("label","features", "value", "innervalue", "analyticvalue");
val regression = new LinearRegression();

val model = regression.fit(data);
val pred = model.transform(data);
val error = pred.select($"value",$"prediction"-$"analyticvalue");
